import ContactForm from './ContactForm';
import { FaJs, FaPhp, FaReact, FaSass, FaLaravel, FaSymfony, FaLinkedin, FaGithub, FaMapMarkerAlt, FaEnvelope } from 'react-icons/fa';
import Mycv from './Mycv';
import { useState } from "react";
import Body from './Body';
import App from './App';


const MyWorks = () => {

    const handleScrollDown = () => {
        window.scroll({
            top: document.body.offsetHeight,
            down: 2,
            behavior: 'smooth',
        });
    }

    return (
        <div>
            <div className="worksCont">
                <h1>MY WORKS</h1>
                <div className="worksCard">
                    <div className="card">
                        <img src="spotify.png" alt="spot" />
                        <h2>Spotify</h2>
                        <h4>Création d’un lecteur multimédia online</h4>
                    </div>
                    <div className="card">
                        <img src="meetic.png" alt="meet" />
                    </div>
                    <div className="card">
                        <img src="puissance.png" alt="puis" />
                    </div>
                    <div className="card">
                        <img src="battleship.png" alt="batt" />
                    </div>
                </div>
            </div>
        </div>
    );
}


export default MyWorks;
